import {Component } from 'react';
import './tilepuzzle.css';

class tilepuzzle extends Component{ 
    render(){
        return(
            <div>
                <div className="mainBox">
                    <div id="boxWithBoxes" className="innerBox">
                        <div id="1" className="boxes"> 1 </div>
                        <div id="2" className="boxes"> 2 </div>
                        <div id="3" className="boxes"> 3 </div>
                        <div id="4" className="boxes"> 4 </div>
                        <div id="5" className="boxes"> 5 </div>
                        <div id="6" className="boxes"> 6 </div>
                        <div id="7" className="boxes"> 7 </div>
                        <div id="8" className="boxes"> 8 </div>
                        <div id="empty" className="emptyBox">  </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default tilepuzzle;
